(84,7,7,23,'AGRICULTURAL INPUT: Based on PRSSPs workshop on Developing the Seed Sector: What Role for Policy?, PRSSP will prepare a related dissemination report and seed policy brief to translate information on this highly technical area for different audiences. These research outputs will also take into consideration that the 2016 draft seed policy was recently.  AGRICULTURAL TRADE POLICY: PRSSP has no planned agricultural trade policy activities in FY 2018. ENABLING ENVIRONMENT: PRSSP researchers will complete a study on agricultural technology adoption using data from IFPRIs Bangladesh Integrated Household Survey (BIHS). INSTITUTIONAL ARCHITECTURE: PRSSP prioritizes capacity building activities within the government as a way of catalyzing long-lasting policy change. In this regard, PRSSP supported IFPRI Headquarters in establishing a platform in the Prime Ministers Office to accelerate progress in improving nutrition. PRSSP was invited to a meeting at USAID on August 13, 2017 with a Bureau for Food Security Policy Analyst, and the BFS Policy Analyst and PRSSP agreed on the need for coordinated, well-functioning, multi-stakeholder platforms. In this regard, the Compact2025 platform in the Prime Ministers Office, which PRSSP will provide support, is anticipated to serve this purpose.LAND AND NATURAL RESOURCES: PRSSP has no planned activities in this policy area in FY 2018. NUTRITION: NPAN-2 was approved in August 2017, and implementation of the plan to monitor and account for the government and development partners progress towards improving nutrition will be underway in 2018, which PRSSP will track. PRSSP was also approached by Global Panel and BRAC to organize a stakeholder consultation on food systems in November 2017 in Dhaka. RESILIENCE AND AGRICULTURAL RISK MANAGEMENT: PRSSP has no planned activities in this policy area in FY 2018. OTHERS: During PRSSPs final year of its second four-year phase (2014-2018), PRSSP researchers will complete all ongoing research studies, including but not limited to the ANGeL pilot project, Bt brinjal impact assessment, WEAI4VC, and conduct the third round of IFPRIs Bangladesh Integrated Household Survey (BIHS). PRSSP will continue to have a flexible workplan, which allows the program to be agile and respond to emerging demands, as needed. '),
