(134,9,26,30,'The beneficiaries under out-year targets will participate in IEHFP training and receive improved summer and winter seeds for on farm and homestead gardening'),
(135,7,26,30,'The beneficiaries under out-year targets will participate in IEHFP training and receive improved summer and winter seeds for on farm and homestead gardening'),
(136,7,26,27,'All the beneficiaries under out-year targets will participate in IEHFP training and receive improved summer and winter seeds for on farm and homestead gardening'),
(137,7,26,29,'The targets are set based on the results of a census carried out in five upazilas under Bandaban. Targets includes one member from each of the poor, very poor and PLW households. The targeted household members will attend IEHFP sessions organized by the project'),
(138,7,9,51,'This indicator reflects new and continuing sequestration of carbon dioxide equivalent emissions (CO2e). Clean energy results for this indicator depend largely on the emissions savings generated from energy efficiency options implementations (EEIOs) and sales of improved cookstoves (ICS). '),
(139,7,9,46,'This indicator measures the number of person hours of training in the private sector and government through USAID Bangladeshs clean energy efforts. These training provide greater capacity to stakeholders to improve enabling environment for increased responsiveness to climate change through acquired in-depth knowledge on energy efficiency improvement options, energy auditing skills, energy pricing, utility regulation and strategies. \r\n\r\nOut-year targets include training programs to be provided for various private sector and GOB beneficiary groups, including managers in the energy efficiency industry, energy auditors, clean energy financiers, power distribution companies, and improved cook stove manufacturers, distributors and service providers.  \r\n'),
(140,7,9,47,'Institutions with improved capacity to address climate change issues will have a new or increased ability to use different approaches, processes, strategies, or methodologies to mitigate and/or adapt to climate change. Measuring improved institutional capacity to address climate change is based on an initial baseline assessment of targeted institutional capacities and a post-intervention assessment.\r\n\r\nThe target number of institutions  seven  for this indicator is the remaining number of institutions in the Life of Project targets. These institutions are mainly in the garment industry or other energy-intensive industries.\r\n'),
(141,7,9,49,'This indicator is based on the amount of funds disbursed in the Bangladesh economy from any source (commercial credit, equity, etc.) for the implementation of improved energy efficiency and energy conservation options in four industrial sectors: textile, frozen-food, jute and steel re-rolling. \r\n\r\nIn FY 2016, CCEB initiated relationships with key entities that make energy efficiency investments. These organizations included banks, trade organizations, training institutions, and other clean energy projects. These entities are in the process of obtaining or have already obtained bilateral or multilateral impact funds earmarked for energy efficiency investments. As of late FY 2016, several of these counterparts already had identified energy efficient projects and were at different stages in the disbursement of funds. CCEB knew that end users receiving funds were expected to complete the commissioning of machinery in early FY 2017, so CCEBs FY 2017 target was based on its calculation of the claimable investment mobilized for the upcoming year.\r\n'),
(142,7,11,24,'The project is closing on November 2017'),
(143,7,28,41,'Nobo Jatra will promote Bottle guard value chain with 3200 farmers. Nobo Jatra will promote Bitter guard value chain with 3200 farmers.'),
(144,7,27,41,'Considering this year achievement, program set FY18 target. It is to noteworthy , FY17 target was set considering base value which was not largely reflected to set a realistic target for out years\r\n\r\nIt is expected that, participants knowledge and capacity will be strengthened through FFBS approach and access to quality inputs will be made through linkage with private sector partner. It is also note here that, demand of selected commodity is increasing which will also help achieving target \r\n'),
(145,7,28,24,'Based on the last years learnings and resources availablity the out year target has been calculated. As the partners and other staffs are on board, out year targetsmay be achieved.  '),
(146,7,27,24,'Considering this year achievement, program set FY18 target. It is to noteworthy , FY17 target was set considering base value which was not largely reflected to set a realistic target for out years\r\n\r\nIt is expected that, participants knowledge and capacity will be strengthened through FFBS approach and access to quality inputs will be made through linkage with private sector partner. It is also note here that, demand of selected commodity is increasing which will also help achieving target \r\nConsidering this year achievement, program set FY18 target. It is to noteworthy , FY17 target was set considering base value which was not largely reflected to set a realistic target for out years\r\n\r\nIt is expected that, participants knowledge and capacity will be strengthened through FFBS approach and access to quality inputs will be made through linkage with private sector partner. It is also note here that, demand of selected commodity is increasing which will also help achieving target '),
(147,7,28,74,'Nobo Jatra project is promoting climate smart agriculture as well as building capacity on disaster risk reduction. Based on the target of agriculture and DRR participants, this target has set.'),
(148,7,27,74,'Considering this year achievement, program set FY18 target. It is to noteworthy , FY17 target was set considering base value which was not largely reflected to set a realistic target for out years\r\nIt is expected that, participants knowledge and capacity will be strengthened through FFBS approach and also from other intervention that emphasizes using climate information into different farming activities '),
